import { styled } from 'styled-components';

export const FilterTimeSlide = styled.div`
  position: relative;
  height: 4px;
  width: 650px;
  border-radius: 10px;
  background-color: #ddd;
`;

export const FilterTimeSlideInner = styled.div`
  position: absolute;
  left: 30%;
  right: 30%;
  heigth: 4px;
  border-radius: 10px;
  background-color: #b0b0b0;
`;

export const FilterPriceRangeWrap = styled.div`
  position: relative;
`;

export const FilterPriceRangeMin = styled.input`
  position: absolute;
  top: -9px;
  width: 100%;
`;

export const FilterPriceRangeMax = styled(FilterPriceRangeMin)``;
